package db.domain;import cn.mxz.util.debuger.Debuger;public class PvpImpl implements Pvp {	@Key	private String uname;	private int danId;	private int practice;	private int shenJia;	public PvpImpl() {	}	public PvpImpl(Pvp c) {		this.uname = c.getUname();		this.danId = c.getDanId();		this.practice = c.getPractice();		this.shenJia = c.getShenJia();	}	@Override	public String tableName() {		return "pvp";	}	public void setUname(String uname) {		this.uname = uname;	}	public String getUname() {		return this.uname;	}public void addUname(String uname) {		this.uname += uname;}	public void setDanId(int danId) {		this.danId = danId;	}	public int getDanId() {		return this.danId;	}public void addDanId(int danId) {		this.danId += danId;}	public void setPractice(int practice) {		if(practice == -1) {			Debuger.debug("PvpImpl.setPractice()");		}		this.practice = practice;	}	public int getPractice() {		return this.practice;	}public void addPractice(int practice) {		this.practice += practice;}	public void setShenJia(int shenJia) {		this.shenJia = shenJia;	}	public int getShenJia() {		return this.shenJia;	}public void addShenJia(int shenJia) {		this.shenJia += shenJia;}}